import MyNavBar from "./Nav";
import heroImage from "../assets/MERN.png"
import "../App.css";

function HeroSection(){
    return(
        <div className="hero" style={{width:'100%'}}>
            <img src={heroImage} alt='hero' width='500'/> 
        </div>
    )
}
function Home(){
    return(
        <div>
            <MyNavBar/>
            <HeroSection/>
        </div>
    )
}

export default Home;
